snippet.textDisplay:
@Lord of all Fevers and Plague o comércio do ramo artístico não se adpta

Basicamente impossível, falo pq trabalho com isso e durante toda a pandemia foi uma desgraça total, e o teu "quem tiver que morrer, que morra" nem faz sentido

Aliás, se uma pessoa tiver contato com o vírus, ela pode ser totalmente desconhecida por você, mas em algum momento, vai acabar chegando em ti ou nos seus familiares, vcs não assimilam isso, impossível

